/*
行政区划数据信息
*/

DROP TABLE IF EXISTS `common_region_info`;
CREATE TABLE `common_region_info` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `region_code` int(6) DEFAULT NULL COMMENT '行政区划编码',
  `region_name` varchar(50) DEFAULT NULL COMMENT '行政区划名称',
  `region_grade` tinyint(1) DEFAULT NULL COMMENT '行政区划级别(1省；2市；3区县)',
  `region_parent_id` bigint(20) DEFAULT NULL COMMENT '上级行政区划ID',
  `region_parent_code` int(6) DEFAULT NULL COMMENT '上级行政区划编码',
  `all_region_ids` varchar(200) DEFAULT NULL COMMENT '行政区划全部ID',
  `all_region_codes` varchar(200) DEFAULT NULL COMMENT '行政区划全部编码',
  `all_region_names` varchar(200) DEFAULT NULL COMMENT '行政区划全部名称',
  `sort_num` int(11) DEFAULT NULL COMMENT '排序号(升序)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='行政区划信息表';

